import './App.css';
import React from 'react';

class App extends React.Component {
  constructor(props) {
    super(props);



  }



  render() {
    return (
      <div>
        <label id='break-label'>Break Length</label>
        <label id='session-label'>Session Length</label>

        <button 
          type='button'
          id='break-decrement'
        >
          &#8595
        </button>
        <button 
          type='button'
          id='break-increment'
        >
          &#8593
        </button>
      </div>
    );
  }
}

export default App;
